import React,{Component} from 'react';
//import logo from './logo.svg';
import './App.css';
import DepartureSearchBox from './DepartureSearchBox';
import ArrivalSearchBox from './ArrivalSearchBox';
import SearchButton from './SearchButton';
import NaviBar from './NaviBar';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl'

class App extends Component {
  render(){
    return(
      <Container>
        {/*App-title*/}
        <Row className="justify-content-center">
          <Col xs={12}>
          <h1 class="text-center border-0 display-4">TOYOBUS</h1>
          </Col>
        </Row>

        {/*Nav-bar*/}
        <Row>
          <Col>
          <NaviBar></NaviBar>
          </Col>
        </Row>
        <br/>
        <br/>
        {/*Departure-search-box component*/}
        <Row>
          <Col xs={2} className="justify-content-center border-dark">
            <h6>出発</h6>
          </Col>
          <Col>
            <Form inLine>
              <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            </Form>
          </Col>
        </Row>

        {/*Arrival-search-box component*/}
        <Row></Row>
        {/*Search-button component*/}
        <Row></Row>
      </Container>


    );
  }
}

export default App;
